import { type } from "os";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import "bootstrap/dist/css/bootstrap.min.css";
import React from "react";
import PropTypes from "prop-types";
import { FaThumbsUp } from 'react-icons/fa';
import login_white   from '../ico/login_white_24dp.svg';
import login_black   from '../ico/login_black_24dp.svg';
import {
  MDBContainer,
  MDBCol,
  MDBRow,
  MDBBtn,
  MDBIcon,
  MDBInput,
  MDBCheckbox,
} from "mdb-react-ui-kit";
import { Button, Form } from "react-bootstrap";

export interface iShema {
  name: "dark1" | "dark2" |"light" ;
}
type tMenu = {
  name: string;
  linkComp: string;
};

const listMenu: tMenu[] = [
  { name: "/MyApp", linkComp: "Home" },
  { name: "/Page2", linkComp: "Features" },
  { name: "/Login", linkComp: "Login" },
];

const Menu = () => {
  return listMenu.map((item) => {
    return <Nav.Link href={item.name}>{item.linkComp}</Nav.Link>;
  });
};

function ColorSchemesExample(props: iShema) {
  const testName: string = "Home";

  const project = () => {
    switch (props.name) {
      case "dark1":
        return (
          <Navbar bg="dark" data-bs-theme="dark">
            <Container>
              <Navbar.Brand href="#home">Navbar</Navbar.Brand>
              <Nav className="me-auto">{Menu()}</Nav>
            </Container>

{/* Toggle Btn for dark/light mode */}
          <div className={`form-check form-switch text-light`}>
            <input className="form-check-input" type="checkbox" id="flexSwitchCheckDefault" />
            <label className="form-check-label" htmlFor="flexSwitchCheckDefault">Dark Mode</label>
          </div>

            <Button
              variant="dark"
              style={{ display: "flex", justifyContent: "right" }}
            >
              Login
            </Button>

          </Navbar>
        );
      case "dark2":
        return (
          <Navbar bg="primary" data-bs-theme="dark">
            <Container>
              <Navbar.Brand href="#home">Navbar</Navbar.Brand>
              <Nav className="me-auto">
                {Menu()}
                {/* <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link> */}
              </Nav>
            </Container>
            <Button
              variant="info"
              style={{ display: "flex", justifyContent: "right" }}
            >
              Login
            </Button>
          </Navbar>
        );
      case "light":
        return (
          <Navbar bg="light" data-bs-theme="light">
            <Container>
              <Navbar.Brand href="#home">Navbar</Navbar.Brand>
              <Nav className="me-auto">
                {Menu()}
                {/* <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link> */}
              </Nav>
            </Container>

            <div className={`form-check form-switch text-dark`}>
            <input className="form-check-input" type="checkbox" id="flexSwitchCheckDefault" />
            <label className="form-check-label" htmlFor="flexSwitchCheckDefault">light {'\r'}</label>
            {'    '}
          </div>
          {'    '}
          <img src={login_black} alt="React Logo" />
            <Button
              variant="light  d"
              style={{ display: "flex", justifyContent: "right" }}
            >
              Login
            </Button>
          </Navbar>
        );
      default:
        return <h1>No project match</h1>;
    }
  };
  return (
    <>
      <div>{project()} </div>
    </>
  );
}

Navbar.propTypes = { 
  title: PropTypes.string.isRequired,  //Set compultion to add title
  aboutText: PropTypes.string 
};

// Here Set default values of title & aboutText if not passed to it
Navbar.defaultProps = {
  title: 'TextUtils',
  //aboutText: 'About'
};


export default ColorSchemesExample;
